import React from 'react';
import { createBrowserRouter } from 'react-router-dom';
import App from '../App.js';

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />,
    children: [
          {
            index: true,
            element: <Navigate to="home" replace />,
          },
    ]
  },
]);

export default router;
